column8:
キャンプを楽しむ白クマのグラフィックのTシャツ。生地は、コットンとポリエステルを混紡。コットンならではの自然な風合いを生かしながら、ポリエステルをブレンドすることで吸汗速乾性を持たせています。におい対策として、抗菌・防臭のポリジン加工を採用。天然の銀イオンが、繊維に付着して悪臭の元となる細菌の繁殖を抑え、においを発生から防止。洗濯を繰り返しても抗菌・防臭効果が長く持続します。肌当たりが優しい転写ロゴと記名ネームを採用。
■メーカー：ヘリーハンセン
■素材：C/E天竺(綿63％、ポリエステル37％)
■サイズ：100cm、110cm、120cm、130cm、140cm、150cm
■特徴：記名ネーム付き／抗菌・防臭加工<style type="text/css">
