コットンの風合いと肌触りが心地よい半袖Tシャツ。ポリエステルを混紡することで、なめらかさと速乾性を確保しています。カラーバリエーションはアウトドアをモチーフにした柄など全5色。ショートスリーブスムースコットンロンパース（NTB31711）などベビーのウエアと連動したデザインで、兄弟姉妹でお揃いも可能です。サイズ70、80、90は左肩がドットボタン仕様で、脱ぎ着がしやすくなっています。ベビーサイズ対応。

■サイズ：70cm、80cm、90cm、100cm、110cm、120cm、130cm、140cm、150cm
■素材：Smooth Cotton（綿60％、ポリエステル40％）
■原産国：中国 
■特徴：80・90cmは着脱しやすいように左肩はドットボタン仕様<style type="text/css">
